// run when plugin activated and create data tabales
function my_api_activation(){

    global $table_my_api_countries,$wpdb;

    $charset_collate = $wpdb->get_charset_collate();

    $sql2 = @"CREATE TABLE $table_my_api_countries  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `country_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `city_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `lat` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `lng` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
)$charset_collate;";

    require_once( ABSPATH . 'wp-admin/includes/upgrade.php' );
    $wpdb->query( $sql2);
}
register_activation_hook(__FILE__,'my_api_activation');

