/**
 * This is our callback function to return our Coutries.
 *
 * @param WP_REST_Request $request This function accepts a rest request to process data.
 */
function my_api_get_countries( $request ) {
    // In practice this function would fetch the desired data. Here we are just making stuff up.
global $table_my_api_countries,$wpdb;
    $countries = $wpdb->get_results("Select distinct country_name from $table_my_api_countries ");
    return rest_ensure_response( $countries );
}

/**
 * This is our callback function to return a cities list in a country.
 *
 * @param WP_REST_Request $request This function accepts a rest request to process data.
 */
function my_api_get_cities( $request ) {

    global $wpdb,$table_my_api_countries;

    // Here we are grabbing the 'country'.
    $country = (string) $request['country'];
    // this function would fetch the desired data.
    $cities = $wpdb->get_results($wpdb->prepare("SELECT city_name,lat,lng from $table_my_api_countries WHERE country_name = %s",$country));

    if (! empty( $cities )) {
        // Return the cities as a response.
        return rest_ensure_response( $cities );
    } else {
        // Return a WP_Error because the request product was not found. In this case we return a 404 because the main resource was not found.
        return new WP_Error( 'rest_country_invalid', esc_html__( 'The country does not exist.', 'my-text-domain' ), array( 'status' => 404 ) );
    }

    // If the code somehow executes to here something bad happened return a 500.
    return new WP_Error( 'rest_api_sad', esc_html__( 'Something went horribly wrong.', 'my-text-domain' ), array( 'status' => 500 ) );
}

/**
 * This function is where we register our routes for our example endpoint.
 */
function register_my_api_routes() {
    // Here we are registering our route for a collection of products.
    register_rest_route( 'get/', '/countries', array(
        // By using this constant we ensure that when the WP_REST_Server changes our readable endpoints will work as intended.
        'methods'  => WP_REST_Server::READABLE,
        // Here we register our callback. The callback is fired when this endpoint is matched by the WP_REST_Server class.
        'callback' => 'my_api_get_countries',
    ) );
    // Here we are registering our route for single products. The (?P<id>[\d]+) is our path variable for the ID, which, in this example, can only be some form of positive number.
    register_rest_route( 'get/cities', '/country=(?P<country>[a-zA-Z0-9-]+)', array(
        // By using this constant we ensure that when the WP_REST_Server changes our readable endpoints will work as intended.
        'methods'  => WP_REST_Server::READABLE,
        // Here we register our callback. The callback is fired when this endpoint is matched by the WP_REST_Server class.
        'callback' => 'my_api_get_cities',
    ) );
}

add_action( 'rest_api_init', 'register_my_api_routes' );

