add_action('wp_ajax_my_api_all_country', 'my_api_all_country');
add_action('wp_ajax_nopriv_my_api_all_country', 'my_api_all_country');
function my_api_all_country()
{
    global $table_my_api_countries,$wpdb;

    // Set database pass !
    wp_send_json($wpdb->get_results("Select distinct country_name from " . $table_my_api_countries ." order by country_name", OBJECT_K));
    wp_die();
}
add_action('wp_ajax_my_api_save_country', 'my_api_save_country');
function my_api_save_country()
{

    global $table_my_api_countries,$wpdb;

    $count = $wpdb->get_results(
        $wpdb->prepare("SELECT count(id) as total FROM {$table_my_api_countries} WHERE country_name=%s AND city_name=%s ", $_POST["new_country"], $_POST["new_city"])
    );
    //wp_send_json($count[0]->total);
    if ($count[0]->total == 0) :
        $data = array('country_name' => $_POST["new_country"], 'city_name' => $_POST["new_city"], 'lat' => $_POST["lat"], 'lng' => $_POST["lng"]);
        $format = array('%s', '%s', '%s', '%s');
        $wpdb->insert($table_my_api_countries, $data, $format);
        wp_send_json($wpdb->insert_id);
    else :
        wp_send_json(
            $wpdb->query(
                $wpdb->prepare("UPDATE {$table_my_api_countries} SET country_name=%s, city_name=%s, lat=%s, lng=%s WHERE country_name=%s AND city_name=%s ", $_POST["new_country"], $_POST["new_city"], $_POST["lat"], $_POST["lng"], $_POST["new_country"], $_POST["new_city"])
            )
        );
    endif;
    wp_die();
}
