add_action('wp_ajax_my_api_deleteCity', 'my_api_deleteCity');
function my_api_deleteCity()
{
    global  $table_my_api_countries,$wpdb;

    //wp_send_json($wpdb->query("delete from {$table} where country_name = $_POST[country] AND city_name = $_POST[city] "));
    wp_send_json(
        $wpdb->delete(
            $table_my_api_countries,
            ['country_name' => $_POST['country'], 'city_name' => $_POST['city']]
        )
    );
    wp_die();
}
